import React, { useState } from 'react';
import { motion } from 'framer-motion';

const InteractiveLines: React.FC = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });

  // Generate positions for main elements
  const generateMainElements = () => {
    return [
      // Center cross
      { x: 50, y: 50, type: 'cross', size: 300 }, // Larger cross
      // Four corner elements
      { x: 15, y: 15, type: 'point', size: 60 }, // Larger points
      { x: 85, y: 15, type: 'point', size: 60 },
      { x: 15, y: 85, type: 'point', size: 60 },
      { x: 85, y: 85, type: 'point', size: 60 },
    ];
  };

  const elements = generateMainElements();

  const handleMouseMove = (e: React.MouseEvent) => {
    const { clientX, clientY } = e;
    setMousePosition({
      x: (clientX / window.innerWidth) * 100,
      y: (clientY / window.innerHeight) * 100
    });
  };

  return (
    <div 
      className="absolute inset-0 overflow-hidden"
      onMouseMove={handleMouseMove}
    >
      <motion.div
        className="absolute top-0 left-0 w-full h-full"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
      >
        {/* Main Elements */}
        {elements.map((element, index) => {
          const distance = Math.sqrt(
            Math.pow(element.x - mousePosition.x, 2) + 
            Math.pow(element.y - mousePosition.y, 2)
          );
          const scale = Math.max(0.8, 1.5 - distance / 50); // More responsive scaling

          if (element.type === 'cross') {
            return (
              <React.Fragment key={`cross-${index}`}>
                {/* Horizontal line */}
                <motion.div
                  className="absolute origin-center"
                  style={{
                    left: `${element.x}%`,
                    top: `${element.y}%`,
                    width: `${element.size}px`,
                    height: '4px', // Thicker line
                    background: 'linear-gradient(to right, #4CAF50, #8BC34A)',
                    transform: 'translate(-50%, -50%)',
                    boxShadow: '0 0 15px rgba(76, 175, 80, 0.5)', // Glow effect
                  }}
                  initial={{ scaleX: 0 }}
                  animate={{ 
                    scaleX: scale,
                    rotate: Math.sin(Date.now() * 0.002) * 15, // More rotation
                  }}
                  transition={{
                    duration: 0.3,
                    repeat: Infinity,
                    repeatType: "reverse",
                    ease: "easeInOut"
                  }}
                />
                {/* Vertical line */}
                <motion.div
                  className="absolute origin-center"
                  style={{
                    left: `${element.x}%`,
                    top: `${element.y}%`,
                    width: '4px', // Thicker line
                    height: `${element.size}px`,
                    background: 'linear-gradient(to bottom, #4CAF50, #8BC34A)',
                    transform: 'translate(-50%, -50%)',
                    boxShadow: '0 0 15px rgba(76, 175, 80, 0.5)', // Glow effect
                  }}
                  initial={{ scaleY: 0 }}
                  animate={{ 
                    scaleY: scale,
                    rotate: Math.cos(Date.now() * 0.002) * 15, // More rotation
                  }}
                  transition={{
                    duration: 0.3,
                    repeat: Infinity,
                    repeatType: "reverse",
                    ease: "easeInOut"
                  }}
                />
              </React.Fragment>
            );
          }

          return (
            <motion.div
              key={`point-${index}`}
              className="absolute rounded-full"
              style={{
                left: `${element.x}%`,
                top: `${element.y}%`,
                width: `${element.size}px`,
                height: `${element.size}px`,
                background: 'radial-gradient(circle, #4CAF50, #8BC34A)',
                transform: 'translate(-50%, -50%)',
                boxShadow: '0 0 30px rgba(76, 175, 80, 0.5)', // Stronger glow
              }}
              initial={{ scale: 0 }}
              animate={{ 
                scale: scale,
                rotate: Math.sin(Date.now() * 0.001 + index) * 360,
                y: Math.sin(Date.now() * 0.002 + index) * 20, // Add vertical movement
              }}
              transition={{
                duration: 1.5,
                repeat: Infinity,
                ease: "linear"
              }}
              whileHover={{
                scale: 1.5,
                background: 'radial-gradient(circle, #2E7D32, #4CAF50)',
                boxShadow: '0 0 40px rgba(46, 125, 50, 0.8)',
                transition: { duration: 0.3 }
              }}
            />
          );
        })}

        {/* Connecting Lines */}
        {elements.slice(1).map((point, index) => (
          <motion.div
            key={`connector-${index}`}
            className="absolute origin-left"
            style={{
              left: '50%',
              top: '50%',
              width: '100%',
              height: '2px', // Thicker line
              background: 'linear-gradient(to right, #4CAF50, transparent)',
              transform: `rotate(${Math.atan2(
                point.y - 50,
                point.x - 50
              ) * 180 / Math.PI}deg)`,
              boxShadow: '0 0 10px rgba(76, 175, 80, 0.3)', // Glow effect
            }}
            initial={{ scaleX: 0 }}
            animate={{ 
              scaleX: 0.7,
              opacity: [0.3, 0.7, 0.3], // More dramatic opacity change
            }}
            transition={{
              duration: 2,
              repeat: Infinity,
              repeatType: "reverse",
              ease: "easeInOut"
            }}
          />
        ))}

        {/* Mouse Trail Effect */}
        <motion.div
          className="absolute rounded-full pointer-events-none"
          style={{
            width: '200px',
            height: '200px',
            background: 'radial-gradient(circle, rgba(76, 175, 80, 0.2), transparent 70%)',
            boxShadow: '0 0 30px rgba(76, 175, 80, 0.2)', // Added glow
          }}
          animate={{
            x: mousePosition.x * window.innerWidth / 100 - 100,
            y: mousePosition.y * window.innerHeight / 100 - 100,
            scale: [1, 1.2, 1], // Pulsing effect
          }}
          transition={{ 
            type: "spring", 
            stiffness: 50, 
            damping: 20,
            scale: {
              duration: 2,
              repeat: Infinity,
              ease: "easeInOut"
            }
          }}
        />
      </motion.div>
    </div>
  );
};

export default InteractiveLines;
